using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;namespace Foundation{	/// <summary>	/// The NSFileAccessIntent class stores the details of coordinated-read and coordinated-write operations. Use this class when performing asynchronous operations with a file coordinator using the coordinatorâ€™s coordinateAccessWithIntents:queue:byAccessor: method.	/// </summary>	/// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/Foundation/Reference/NSFileAccessIntent_Class/index.html#//apple_ref/occ/cl/NSFileAccessIntent"/>	[iOSVersion(8)]	public class NSFileAccessIntent : NSObject//, AnyObject, NSObjectProtocol	{		/// <summary>		/// Returns a file access intent object for reading the given URL with the provided options.		/// </summary>		/// <param name="url">The URL of the document you intend to read from.</param>		/// <param name="options">The coordinated reading options. For a list of valid values, see NSFileCoordinatorReadingOptions in the NSFileCoordinator Class Reference.</param>		[iOSVersion(8)]		[Export("readingIntentWithURL")]		public static Self ReadingIntentWithURL(NSURL url, NSFileCoordinatorReadingOptions options) { return default(Self); }				/// <summary>		/// Returns a file access intent object for writing to the given URL with the provided options.		/// </summary>		/// <param name="url">The URL of the document you intend to write to.</param>		/// <param name="options">The coordinated writing options. For a list of valid values, see NSFileCoordinatorWritingOptions in the NSFileCoordinator Class Reference.</param>		[iOSVersion(8)]		[Export("writingIntentWithURL")]		public static Self WritingIntentWithURL(NSURL url, NSFileCoordinatorWritingOptions options) { return default(Self); }				/// <summary>		/// The current URL for the item managed by the file access intent instance. (read-only)		/// </summary>		[iOSVersion(8)]		public NSURL URL { get; private set; }	}}